# A generic, single database configuration.

[alembic]
# path to migration scripts
script_location = alembic

# template used to generate migration files
file_template = %%(rev)s_%%(slug)s

# timezone to use when rendering the date within the migration file as well as
# the filename.
# If False, then use the system timezone.
# If True, then use UTC.
# Or specify a timezone string directly.
timezone = UTC

